<!DOCTYPE html>
<html xmlns:th="http://www.thymeleaf.org" xmlns:sec="http://www.thymeleaf.org/extras/spring-security">
<head th:replace="fragments/head :: head_fragment(title = 'User List', links = ~{::link}, scripts = ~{::script})">
	<link rel="stylesheet" th:href="@{/css/pofile.css}">
	<script type="text/javascript" th:src="@{/js/profile.js}"></script>
</head>
<body>
	<!-- サイドバー -->
	<div class="page-wrapper chiller-theme toggled">
		<div th:replace="fragments/Sidenav :: sidenav"></div>
		<main class="page-content animsition">


			<div id="settings">
				<!-- tag title -->
				<input checked class="nav" name="nav" type="radio">
				<span class="nav">Profile</span>
				<input class="nav" name="nav" type="radio">
				<span class="nav">Suggest</span>
				<input class="nav" name="nav" type="radio">
				<span class="nav">Account</span>
				<input class="nav" name="nav" type="radio">
				<span class="nav">Advanced</span>
				
				<!-- profile content -->
				<main class="content">
					<!-- 
						<form th:action="@{/profile/ProfileEdit.do}" autocomplete="off" class="animsition"
							enctype="multipart/form-data" method="post" th:object="${profileEditForm}">
					 -->
					<section id="profile">
						<!-- 
						 -->
						<form th:action="@{/profile/ProfileEdit.do}" autocomplete="off" class="animsition"
							enctype="multipart/form-data" method="post" th:object="${profileEditForm}">
						 <div class="tab-content">
							<ul>
								<li class="large padding avatar">
									<img th:src="${targetUser.profileImage.encodedString}"
										 alt="" class="profile-photo" id="thumbnail" />
									<div>
										<fieldset class="material-button">
											<div>
												<label for="photo-file" class="btn btn-secondary btn-sm shadow-sm">Select File</label>
												<input type="file" id="photo-file" class="d-none" accept="image/*"
													th:field="*{uploadFile}" />
											</div>
										</fieldset>
									</div>
								</li>
								<li>
									<fieldset class="material">
										<div>
											<input type="text" th:field="*{name}" placeholder="ユーザー名">
											<label>Name</label>
											<hr>
										</div>
									</fieldset>
								</li>
								<li>
									<fieldset class="material">
										<div>
											<input id="zipcode" type="text"
												class="" th:field="*{zipcode}" placeholder="郵便番号"
												th:classappend="${#fields.hasErrors('zipcode') ? 'is-invalid bg-light' : ''}" />
												<!-- 
											<button type="button" id="search-address"
												class="">住所検索</button>
												 -->
											<label>Zipcode</label>
											<hr>
										</div>
									</fieldset>
								</li>
								<li>
									<fieldset class="material">
										<div>
											<span th:text="${targetUser.empNo}"></span>
											<label>User number</label>
											<hr>
										</div>
									</fieldset>
								</li>
								<li>
									<fieldset class="material">
										<div>
											<input id="pref" type="text" class=""
												th:field="*{pref}" placeholder="住所"
												th:classappend="${#fields.hasErrors('pref') ? 'is-invalid bg-light' : ''}" />
											<label>Address</label>
											<hr>
										</div>
									</fieldset>
								</li>
								<li class="large">
									<fieldset class="material">
										<div>
											<label class="textarea-label">About me</label>
											<textarea th:field="*{aboutMe}" required placeholder=""
												th:classappend="${#fields.hasErrors('aboutMe') ? 'is-invalid bg-light' : ''}" ></textarea>
										<!-- 
											<input type="text" class=""
												th:field="*{aboutMe}" placeholder="自己紹介（256文字以内）"
												th:classappend="${#fields.hasErrors('aboutMe') ? 'is-invalid bg-light' : ''}" />
										 -->
											<hr>
										</div>
									</fieldset>
								</li>
								<li class="large padding save-button">
									<fieldset class="material-button center">
										<div>
											<input class="save" type="submit" value="Save">
										</div>
									</fieldset>
								</li>
							</ul>
							<!-- ユーザー情報更新項目 -->
							<input type="hidden" th:field="*{userId}">
							<input type="hidden" th:field="*{empNo}">
						<!-- 
						</div>
						 -->
						</form>
					</section>
					
					<!-- sujest users -->
					<section id="privacy">
						<div class="tab-content">
						<!-- 
						<form th:action="@{/profile/ProfileEdit.do}" autocomplete="off" class="animsition"
							enctype="multipart/form-data" method="post" th:object="${profileEditForm}">
						 -->

										<fieldset class="material-button">
											<div>
												<label for="photo-file" class="btn btn-secondary btn-sm shadow-sm">Select File</label>

										</fieldset>
									</div>
								</li>
								<li>
									<fieldset class="material">
										<div>
											<input type="text" placeholder="ユーザー名" id="name" name="name" value="管理者権限">
											<label>Name</label>
											<hr>
										</div>
									</fieldset>
								</li>
								<li>
									<fieldset class="material">
										<div>
											<input id="zipcode" type="text" class="" placeholder="郵便番号" name="zipcode" value="">
												<!-- 
											<button type="button" id="search-address"
												class="">住所検索</button>
												 -->
											<label>Zipcode</label>
											<hr>
										</div>
									</fieldset>
								</li>
								<li>
									<fieldset class="material">
										<div>
											<span>20210902</span>
											<label>User number</label>
											<hr>
										</div>
									</fieldset>
								</li>
								<li>
									<fieldset class="material">
										<div>
											<input id="pref" type="text" class="" placeholder="住所" name="pref" value="">
											<label>Address</label>
											<hr>
										</div>
									</fieldset>
								</li>
								<li class="large">
									<fieldset class="material">
										<div>
											<input  type="text" class="" placeholder="自己紹介（256文字以内）" 
													id="aboutMe" name="aboutMe" value="WWWWWWWWWWWWWWW">
										<!-- 
											<textarea type="text" class="" th:field="*{aboutMe}" ></textarea>
										 -->
											<label>About me</label>
											<hr>
										</div>
									</fieldset>
								</li>
								<li class="large padding save-button">
									<fieldset class="material-button center">
										<div>
											<input class="save" type="submit" value="Save">
										</div>
									</fieldset>
								</li>
							</ul>
						<!-- 
						</form>
						 -->
						</div>
					</section>
					
					<!-- account setting -->
					<section id="account">
						<!-- 
						 <div class="tab-content">
						 -->
						<form th:action="@{/profile/ProfileEdit.do}" autocomplete="off" class="animsition"
							enctype="multipart/form-data" method="post" th:object="${profileEditForm}">
							<ul>
								<li class="large padding avatar">
									<img th:src="${targetUser.profileImage.encodedString}"
										 alt="" class="profile-photo" id="thumbnail" />
								</li>
								<li>
									<fieldset class="material">
										<div>
											<input type="email" placeholder="change your email" th:field="*{email}"
												th:classappend="${#fields.hasErrors('email') ? 'is-invalid bg-light' : ''}" />
											<span th:text="${email}"></span>
											<label>Email</label>
											<hr>
										</div>
									</fieldset>
								</li>
								<li>
									<fieldset class="material">
										<div>
											<!-- 
											<input type="text" th:field="*{name}" placeholder="ユーザー名">
											<label>Name</label>
											<hr>
											 -->
										</div>
									</fieldset>
								</li>
								<li>
									<fieldset class="material">
										<div>
											<input type="password" placeholder="change your password" th:field="*{password}"
												th:classappend="${#fields.hasErrors('password') || #fields.hasErrors('passwordConfirmed') 
																	? 'is-invalid bg-light' : ''}" />
											<label>Password</label>
											<hr>
										</div>
									</fieldset>
								</li>
								<li>
									<fieldset class="material">
										<div>
											<input type="password" placeholder="please re-enter." th:field="*{passwordConfirm}"
												th:classappend="${#fields.hasErrors('passwordConfirm') || 
																	#fields.hasErrors('passwordConfirmed') ? 'is-invalid bg-light' : ''}" />
											<label>Confirm Password</label>
											<hr>
										</div>
									</fieldset>
								</li>
								<li class="large padding save-button">
									<fieldset class="material-button center">
										<div>
											<input class="save" type="submit" value="Save">
										</div>
									</fieldset>
								</li>
							</ul>
							<!-- ユーザー情報更新項目 -->
							<input type="hidden" th:field="*{userId}">
							<input type="hidden" th:field="*{empNo}">
						</form>
						<!-- 
						</div>
						 -->
					</section>
					
					
					<!-- and more -->
					<section class="upcoming" id="privacy">
						<h1>Coming soon!</h1>

						</form>
